import React from 'react'
import { useSelector } from 'react-redux'
import Card from '../Card';


export default function Home() {

    const movies = useSelector(state => state.movies);

  return (
    <div>
        <h1>Movies List</h1>
        <hr/>
        <div>
            {movies.map(movie => 
            <Card
                key={movie.imdbID}
                id={movie.imdbID}
                title={movie.Title}
                type='fav'
            />)}
        </div>

    </div>
  )
}
